$\begin{array}{ll}
N			&: \mbox{number of code-vectors=number of $p$-tuples}\\
j			&: p \mbox{-tuple index, } j \in \{0, 1, \ldots, N-1\}\\
y^e_j		&: \mbox{equivalent code-vector using $j$-th p-tuple}\\
S^e_j		&:\mbox{partition for $y^e_j$ equivalent code-vector}\\
y_j(p)		&: \mbox{code-vector at $p$-th stage using $j$-th p-tuple}\\
\mathbf{y}_{{\rho}_k}	&: \mbox{code-vector at $\rho$-th stage and $k$-th template}\\
H(\rho,k)	&: \mbox{set of $p$-tuples that contain $y(\rho,k)$ code-vector}
\end{array}
$

$			
\begin{array}{lllll}
MSE 								&= \sum\limits_{j=0}^{N-1}\int\limits_{S^e_j}(x-y^e_j)^2f_X(x)dx 	\\
									&=\int\limits_{S^e_0}(x-y^e_0)^2f_X(x)dx 	+	\int\limits_{S^e_1}(x-y^e_1)^2f_X(x)dx +	\ldots 	+	\int\limits_{S^e_{N-1}}(x-y^e_{N-1})^2f_X(x)dx	\\
\frac{\partial MSE}{\partial y_{{\rho}_k}} 	&=\int\limits_{S^e_0}2(x-y^e_0)\frac{\partial y^e_0}{\partial y_{{\rho}_k}}f_X(x)dx	+	\int\limits_{S^e_1}2(x-y^e_1)\frac{\partial y^e_1}{\partial y_{{\rho}_k}}f_X(x)dx 	+ \ldots 	+ \int\limits_{S^e_{N-1}}2(x-y^e_{N-1})\frac{\partial y^e_{N-1}}{\partial y_{{\rho}_k}}f_X(x)dx		\\
									&= \sum\limits_{j=0}^{N-1}\int\limits_{S^e_j}2(x-y^e_j)\frac{\partial y^e_j}{\partial y_{{\rho}_k}}f_X(x)dx								&																		&			&\\
&=\left\{
\begin{array}{ll}
\sum\limits_{j=0}^{N-1}\int\limits_{S^e_j}2(x-y^e_j)(1)f_X(x)dx\\
0
\end{array}
\right.								
\begin{array}{l}
\mbox{if } j \in H(\rho, k), \mbox{ i.e., } y^e_j = \ldots + y(\rho,k) + \ldots=\sum\limits_{p=0,p \neq \rho}^{P-1}y_j(p) + y_{{\rho}_k}\\
\mbox{otherwise}
\end{array}\\
&=\sum\limits_{j \in H(\rho,k)}\int\limits_{S^e_j}2\left(x-\left[\sum\limits_{p=0,p \neq \rho}^{P-1}y_j(p) + y_{{\rho}_k}\right]\right)f_X(x)dx 	\\
\mbox{let } \frac{\partial MSE}{\partial y_{{\rho}_k}} 				&=0		\\
\end{array}
$
